import React,{useState} from "react";
import {json, useNavigate} from "react-router-dom";


var myObject;
function handleResponse(){
  console.log(" Handling Response");
  fetch("http://localhost:8081/").then((res)=>res.json())
  .then((json)=>{
    console.log(json);

    const valuesArray=json
    var myObject=    valuesArray.bus1
    // myObject= JSON.parse(json);
    console.log(myObject);

  })
  return(myObject)
}

function PersonalPage(){
    const [passengerName,setpassengerName]= useState();
    const [age,setage]= useState();
    const [email,setemail]= useState();
    const navigate=useNavigate();


    const personalPageSubmit = event => {
        event.preventDefault(); 

        console.log('personalPageSubmit done');
        navigate("confirmationpage");

    };


    var jsonres={
      "fromName": "Shimoga",
      "toName": "Banglore",
      "bus1": {
        "number": "Ka01kj324",
        "time": "5am"
      },
      "bus2": {
        "number": "Ka01kj3444",
        "time": "11am"
      },
      "bus3": {
        "number": "Ka01kj31124",
        "time": "7pm"
      },
      "bus4": {
        "number": "Ka01kj32994",
        "time": "8pm"
      }
    }

    return(

      <>
      {handleResponse()}
      <div className='Place'>
        <h2>
          Destination Details
        </h2>
        <select className="PlaceNames">
          <option value="1">Bus no: ka09123 time: 12pm</option>
          <option value="2">Bus no: ka0567 time: 1pm</option>
          <option value="3">Bus no: ka34567 time: 2pm</option>
          <option value="4">Bus no: ka091789 time: 8am</option>

        </select>
      </div><form className='SubmitPlaces' onSubmit={personalPageSubmit}>
            <div>
            <b>Enter passenger Name     </b>
            <input
              id="passengerName"
              name="passengerName"
              type="text"
              onChange={event => passengerName(event.target.value)}
              value={passengerName} />
            </div>
            <div>
            <b>Enter age of passenger    </b>
            <input
              id="age"
              name="age"
              type="text"
              onChange={event => age(event.target.value)}
              value={age} />
               </div>
               <div>
             <b>Enter your E-mail id    </b>


            <input
              id="email"
              name="email"
              type="text"
              onChange={event => email(event.target.value)}
              value={email} />
            </div>

          <button type='submit'> Submit</button>
        </form></>
    )

}
export default PersonalPage;
